import React from "react";
import './App.scss';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Admin from "./pages/Admin";

function App() {
  return (
      <div className="app">
        <h1>Estamos en App</h1>
        <Admin />
      </div>   
  );
};

function Home(){
  return <h2>Estamos en el componente HOME</h2>;
};
function Contact(){
  return <h2>Estamos en el componente CONTACTOS</h2>;
};
function Users(){
  return <h2>Estamos en el componente USUARIOS</h2>;
};
function Error404(){
  return <h2>Error 404 ...</h2>;
};

export default App;
